var minDate = null,
    maxDate = null

var dateInit = function (event) {
  var getLastWeek = function(t) {
        void 0 === t && (t = new Date)
        var e = t
        e.setDate(e.getDate() - e.getDay() - 1)
        var a = new Date(e)
        a.setDate(a.getDate() - a.getDay())
        e.getMonth() + 1 < 10 ? "0" + (e.getMonth() + 1).toString() : (e.getMonth() + 1).toString(), e.getDate() < 10 ? "0" + e.getDate().toString() : e.getDate().toString(), a.getMonth() + 1 < 10 ? "0" + (a.getMonth() + 1).toString() : (a.getMonth() + 1).toString(), a.getDate() < 10 ? "0" + a.getDate().toString() : a.getDate().toString()
        return {
            startkey: a,
            endkey: e
        }
    }

    var t = getLastWeek()
    $("#datepicker").datepicker({
        autoclose: !0,
        disableTouchKeyboard: !0,
        todayBtn: "linked",
        todayHighlight: !0
    }), 
    $("#startdate").val(moment(t.startkey).format("MM/DD/YYYY")), 
    $("#startdate").datepicker("update"), 
    $("#enddate").val(moment(t.endkey).format("MM/DD/YYYY")), 
    $("#enddate").datepicker("update")
}